import React from 'react';
import { motion } from 'framer-motion';

const Features = () => {
  const services = [
    {
      icon: "ðŸ’»",
      title: "Web Development",
      description: "Creating responsive and modern web applications using latest technologies like React, Node.js, and modern frameworks.",
      color: "from-cyan-400 to-blue-500"
    },
    {
      icon: "ðŸŽ¨",
      title: "Graphic Design",
      description: "Designing beautiful and functional user interfaces with focus on user experience and modern design principles.",
      color: "from-blue-400 to-purple-500"
    },
    {
      icon: "ðŸ“±",
      title: "Digital Marketing",
      description: "Building engaging content strategies and growing online presence through YouTube, social media, and digital platforms.",
      color: "from-purple-400 to-pink-500"
    }
  ];

  return (
    <section id="services" className="py-20 px-6 relative overflow-hidden">
      {/* Background Elements */}
      <div className="absolute inset-0">
        <div className="absolute top-20 right-20 w-96 h-96 bg-cyan-500/5 rounded-full blur-3xl"></div>
        <div className="absolute bottom-20 left-20 w-80 h-80 bg-blue-500/5 rounded-full blur-3xl"></div>
      </div>

      <div className="max-w-7xl mx-auto relative z-10">
        {/* Section Header */}
        <motion.div
          className="text-center mb-16"
          initial={{ opacity: 0, y: 50 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 1 }}
          viewport={{ once: true }}
        >
          <h2 className="text-4xl md:text-5xl font-bold text-white mb-4">
            My <span className="text-cyan-400">Services</span>
          </h2>
          <p className="text-gray-300 text-lg max-w-2xl mx-auto">
            Comprehensive digital solutions tailored to meet your business needs and drive growth
          </p>
        </motion.div>

        {/* Services Grid */}
        <div className="grid md:grid-cols-2 lg:grid-cols-3 gap-8">
          {services.map((service, index) => (
            <motion.div
              key={service.title}
              className="gaming-card p-8 text-center group cursor-pointer relative overflow-hidden"
              initial={{ opacity: 0, y: 50, rotateX: -15 }}
              whileInView={{ opacity: 1, y: 0, rotateX: 0 }}
              transition={{ delay: index * 0.2, duration: 0.8, ease: "easeOut" }}
              viewport={{ once: true }}
              whileHover={{ 
                scale: 1.05,
                y: -12,
                rotateY: 8,
                rotateX: 5
              }}
            >
              {/* Animated background gradient */}
              <motion.div
                className={`absolute inset-0 bg-gradient-to-br ${service.color} opacity-0 group-hover:opacity-10 transition-opacity duration-500 rounded-2xl`}
                whileHover={{ scale: 1.1 }}
              />

              {/* Glowing border effect */}
              <motion.div
                className="absolute inset-0 rounded-2xl opacity-0 group-hover:opacity-100 transition-opacity duration-500"
                style={{
                  background: `linear-gradient(45deg, transparent, rgba(0, 255, 255, 0.1), transparent)`,
                  padding: '2px'
                }}
              />

              {/* Icon with enhanced effects */}
              <motion.div
                className="text-6xl mb-6 relative z-10"
                whileHover={{ 
                  scale: 1.3, 
                  rotate: 15,
                  filter: "drop-shadow(0 0 20px rgba(0, 255, 255, 0.6))"
                }}
                transition={{ duration: 0.3, ease: "easeOut" }}
              >
                {service.icon}
              </motion.div>

              {/* Title with gradient effect */}
              <motion.h3 
                className="text-2xl font-bold mb-4 group-hover:text-transparent group-hover:bg-clip-text group-hover:bg-gradient-to-r group-hover:from-cyan-400 group-hover:to-blue-500 transition-all duration-300 relative z-10"
                style={{
                  color: 'white'
                }}
                whileHover={{ y: -2 }}
              >
                {service.title}
              </motion.h3>

              {/* Description */}
              <p className="text-gray-300 leading-relaxed mb-6 group-hover:text-gray-200 transition-colors duration-300 relative z-10">
                {service.description}
              </p>

              {/* Enhanced Learn More Button */}
              <motion.button
                className="w-full py-4 bg-slate-800/50 border border-cyan-400/30 rounded-xl font-semibold text-cyan-400 transition-all duration-300 hover:bg-cyan-400/20 hover:border-cyan-400 hover:shadow-lg hover:shadow-cyan-400/25 relative z-10 group-hover:scale-105"
                whileHover={{ 
                  scale: 1.02,
                  boxShadow: "0 10px 30px rgba(0, 212, 255, 0.3)"
                }}
                whileTap={{ scale: 0.98 }}
              >
                <motion.span
                  className="flex items-center justify-center space-x-2"
                  whileHover={{ x: 5 }}
                >
                  <span>Learn More</span>
                  <motion.span
                    animate={{ x: [0, 5, 0] }}
                    transition={{ duration: 1.5, repeat: Infinity }}
                  >
                    â†’
                  </motion.span>
                </motion.span>
              </motion.button>

              {/* Corner accent lines */}
              <motion.div
                className="absolute top-0 left-0 w-8 h-8 border-t-2 border-l-2 border-cyan-400/50 rounded-tl-2xl opacity-0 group-hover:opacity-100 transition-opacity duration-500"
              />
              <motion.div
                className="absolute bottom-0 right-0 w-8 h-8 border-b-2 border-r-2 border-cyan-400/50 rounded-br-2xl opacity-0 group-hover:opacity-100 transition-opacity duration-500"
              />
            </motion.div>
          ))}
        </div>

        {/* Bottom CTA */}
        <motion.div
          className="text-center mt-16"
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ delay: 0.8, duration: 0.8 }}
          viewport={{ once: true }}
        >
          <motion.button
            className="gaming-btn font-semibold px-10 py-4"
            whileHover={{ scale: 1.05 }}
            whileTap={{ scale: 0.95 }}
          >
            View All Services
          </motion.button>
        </motion.div>
      </div>
    </section>
  );
};

export default Features;
